import React, { useState } from 'react';
import "./table.css"

const Table = ({ data }) => {
    const [searchTerm, setSearchTerm] = useState('');

    const handleSearch = (event) => {
        setSearchTerm(event.target.value);
    };

    const filteredData = data.filter((item) =>
        item.attackerIP.includes(searchTerm)
    );

    return (
        <div>
            <div className="filter-form">
                <div className="form-row">
                    <label htmlFor="serviceName">Filter By Service Name:</label>
                    <input type="text" value={searchTerm} id="serviceName" onChange={handleSearch}
                           placeholder="Search by Service Name"/>
                </div>
                <div className="form-row">
                    <label htmlFor="fromDate">Filter By Date:</label>
                    <input type="Date" value={searchTerm} id="fromDate" onChange={handleSearch}
                           placeholder="From Date"/>
                    <input type="Date" value={searchTerm} id="toDate" onChange={handleSearch} placeholder="To Date"/>
                </div>
                <div className="form-row">
                    <label htmlFor="attackerIP">Filter By Attacker IP:</label>
                    <input type="text" value={searchTerm} id="attackerIP" onChange={handleSearch}
                           placeholder="Search by Attacker IP"/>
                </div>
                <div className="form-row">
                    <label htmlFor="trapName">Filter By Trap Name:</label>
                    <input type="text" value={searchTerm} id="trapName" onChange={handleSearch}
                           placeholder="Search by Trap Name"/>
                </div>
            </div>

            <table>
                <thead>
                <tr>
                    <th>Report ID</th>
                    <th>Service Name</th>
                    <th>Date</th>
                    <th>Company</th>
                    <th>Attacker IP</th>
                    <th>Trap Name</th>
                    <th>Session INFO</th>
                </tr>
                </thead>
                <tbody>
                {filteredData.map((item) => (
                    <tr key={item.reportID}>
                        <td>{item.reportID}</td>
                        <td>{item.serviceName}</td>
                        <td>{item.date}</td>
                        <td>{item.company}</td>
                        <td>{item.attackerIP}</td>
                        <td>{item.trapName}</td>
                        <td>{item.sessionINFO}</td>
                    </tr>
                ))}
                </tbody>
            </table>
        </div>
    );
};

export default Table;
